define("bundles/facilitated-cdp/data/course/fundamentals-of-graphic-design",["require","exports","module","i18n!nls/facilitated-cdp"],function(require,exports,module){var e=require("i18n!nls/facilitated-cdp");module.exports={bannerImageFilename:"fundamentals-of-graphic-design.jpg",hasPrerequisites:!0,mentors:[{id:16913901,title:e("Freelance Graphic Designer and printmaker"),notes:[e("Holds a Master’s in Fine Art"),e("He’s worked with clients such as Nike and Intel but he also produces his own expressive and experimental\n          work"),e("Experienced printmaking and graphic design instructor at CalArts"),e("Is a film, coffee, and human movement nerd, so if you ever want to talk about the latest wonderfully-bad\n          movie or the finer points of jiu-jitsu, you'll be in good company.")],valueProp:{title:e("Get mentored by creative professionals"),description:e("\n          Learning online is challenging. Maximize your success by working with an expert mentor who keeps you\n          accountable, helps you master the material and gives you a window into the world of a creative professional.\n        ")}}],whatYouLearn:{title:e("Master the skills every designer needs to know"),description:e("\n      Learn the foundational principles that are common in all areas of graphic design practice. If you want to be a\n      designer you have to be a maker, a communicator, so this course will offer you lots of opportunities to get your\n      hands dirty with exercises and with more practical projects.\n    "),thingsYouLearn:[{title:e("Learn and apply graphic design principles"),description:e("\n          Work with a design expert to learn the fundamental principles such as imagemaking, typography, color, and\n          composition.\n        "),iconFilename:"magnifying-glass.png"},{title:e("Learn with experts"),description:e("\n          This course was created by a leading design school, with instructors who are leaders in their field. Your\n          mentor is a real creative professional who can guide your work with immediate and thoughtful feedback.\n        "),iconFilename:"lightbulb.png"},{title:e("Learn by doing"),description:e("\n          You’ll create a business card and a band poster, experiment with colors and shapes and more. You’ll receive\n          real-time feedback from professional designers and peers for every project.\n        "),iconFilename:"triangle.png"}]}}});
