define("bundles/facilitated-cdp/data/course/project-management",["require","exports","module","i18n!nls/facilitated-cdp"],function(require,exports,module){var e=require("i18n!nls/facilitated-cdp");module.exports={bannerImageFilename:null,hasPrerequisites:!1,mentors:[{id:5038650,title:e("Doctoral Candidate in Education Administration at The Ohio State University"),notes:[e("Project lead for two federal grant programs focused on community needs and innovation"),e("Experienced educator with 30+ years teaching adult, high school, and elementary programs"),e("Doctoral work focused on the intersection of technology, education, and innovative school and program\n          design")],valueProp:{title:e("Get mentored by an experienced project manager"),description:e("\n          Learning online is challenging. Maximize your success by working with an expert mentor who keeps you\n          accountable, helps you master the material and gives you a window into the world of an experienced project\n          manager.\n        ")}}],whatYouLearn:{title:e("Master the skills every project manager needs to know"),description:e("\n      Planning principles and execution methods can help projects be run more effectively and efficiently. This is an\n      introductory course on the key concepts of planning and executing projects. We will identify factors that lead to\n      project success, and learn how to plan, analyze, and manage projects. You’ll be exposed to state-of-the-art\n      methodologies and consider the challenges of various types of projects.\n    "),thingsYouLearn:[{title:e("Develop a high-impact project plan"),description:e("\n          Learn how to set objectives, manage key activities and measure results in any project. Apply these frameworks\n          to your next important project with our experts.\n        "),iconFilename:"lightbulb.png"},{title:e("Align organizations and stakeholders"),description:e("\n          Project managers work in increasingly complex, changing environments. You’ll learn practical tips for how to\n          build momentum across your team.\n        "),iconFilename:"briefcase.png"},{title:e("Executive effectively"),description:e("\n          Learn practical frameworks like Scrum, Agile and Kanban to improve performance and boost results.\n        "),iconFilename:"wrench.png"}]}}});
